import React, { Component, Fragment } from 'react';
import {Paper, Card, CardActionArea} from '@material-ui/core';


import './Parking.scss';

 class Parking extends Component {


    render(props) {

        //console.log(this.props.params.id);



        return (
            <Fragment>

                    <div className="parking" onClick={this.props.clicked}>
                        <div className="parking__wrapper">


                                <div className="parking__wrapper_card">
                                <Card className="parking__wrapper_card_card">
                                    <CardActionArea className="parking__wrapper_card_card_box">
                                    {/* <Link to={'/parking-details/' +this.props.id} style={{ textDecoration: 'none' }}> */}
                                    <div className="parking__wrapper_card_data">
                                        Parking Space  <b>{this.props.title}</b> 
                                    </div>
                                    <div className="parking__wrapper_card_data">
                                        <p className="parking__wrapper_card_data_title"><b>Type</b> </p> 
                                        <p className="parking__wrapper_card_data_value">:Commercial </p> 
                                    </div>
                                    <div className="parking__wrapper_card_data">
                                        <p className="parking__wrapper_card_data_title"><b>Operation Time</b> </p> 
                                        <p className="parking__wrapper_card_data_value"> :10.00 am - 8.00 pm  </p> 
                                    </div>

                                    <div className="parking__wrapper_card_data">
                                        <p className="parking__wrapper_card_data_title"><b>Tarrif</b> </p> 
                                        <p className="parking__wrapper_card_data_value"> :{this.props.created}   </p> 


                                    </div>
                                    <div className="parking__wrapper_card_data">
                                        <p className="parking__wrapper_card_data_title"><b>Address</b> </p> 
                                        <p className="parking__wrapper_card_data_value">  :Lorem ipsum,1st main, 2 ross,sum orem - 560 001  </p> 


                                    </div>
                                    </CardActionArea>
                                </Card>
                                </div>


                        </div>
                    </div>


            </Fragment>

        )
    }
}
export default Parking;
